pragma solidity ^0.4.20;

import "./Ownable.sol";

contract HashCommit is Ownable {
  constructor() public Ownable() { }

  event Hash(bytes32 hash, bytes32 newMasterHash);

  bytes32 public masterHash = 0x0;

  function updateHash(bytes32 hash) onlyOwner public {
    masterHash = sha3(hash, masterHash);
    emit Hash(hash, masterHash);
  }

  function hashAlgo() public returns(string){
    return '// js\n web3.utils.soliditySha3(hash, masterHash);';
  }

  // Ownable interface
  function getOwner() public view returns (address) { return _getOwner(); }

  function transferOwnership(address newOwner) public { return _transferOwnership(newOwner); }

}
